<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1" />
<title>VITAC – Merluza de Cola (Definitivo)</title>
<style>
  :root { --cols: 7; --rows: 30; }
  * { box-sizing: border-box; }
  html, body { margin: 0; height: 100%; font-family: Arial, sans-serif; }
  #grid { display: grid; grid-template-columns: repeat(7, 1fr);
          grid-template-rows: repeat(30, 1fr); height: 100vh;
          gap: 4px; padding: 4px; background: #fafafa; }
  .cell { border: 1px solid #e0e0e0; background:#fff; min-width:0; }

  /* Logo */
  #logo { grid-column: 1 / 2; grid-row: 1 / 5; background: #004f9e;
          display: flex; align-items: center; justify-content: center;
          border-radius: 6px; overflow: hidden; }
  #logo img { max-width: 100%; max-height: 100%; object-fit: contain; }

  /* Toggle bar BETWEEN logo and lance buttons */
  #selectorControls { grid-column: 1 / 2; grid-row: 5 / 6; background:#f1f1f1;
                      display:flex; align-items:center; gap:8px; padding:6px; border-radius:6px; }
  #selectorControls button { padding:6px 10px; border:1px solid #cfd6e4; background:#fff; border-radius:6px; cursor:pointer; font-weight:700 }
  #selectorControls button.is-on{ background:#004f9e; color:#fff; border-color:#004f9e }
  #selectorControls button:disabled{ opacity:.55; cursor:not-allowed }
  #selCount{ margin-left:auto; font-size:.9rem; color:#333; white-space:nowrap; overflow:hidden; text-overflow:ellipsis; max-width:40%; }

  /* Lance buttons list (left column) */
  #selector { grid-column: 1 / 2; grid-row: 6 / 31; background: #f1f1f1;
               padding: 6px; overflow-y: auto; border-radius: 6px;
               display: grid; grid-template-columns: 1fr 1fr; gap: 6px; }
  /* Unselected: white card */
  #selector button { width: 100%; padding: 22px 6px;
                     border: 2px solid #e3e7ef; background: #ffffff; color:#111;
                     cursor: pointer; border-radius: 8px; font-weight:700; font-size: 0.95rem;
                     transition: box-shadow .2s, transform .02s; }
  #selector button:hover { box-shadow: 0 0 0 3px #cfe8ff inset; }
  /* Selected: filled blue */
  #selector button.active { background: #0b58a0; color: #fff; border-color:#0b58a0; box-shadow: 0 0 0 2px #9fd4ff inset; }

  /* Chart containers and panels (keep original positions) */
  #chartMcolaCont { grid-column: 2 / 4; grid-row: 1 / 14; background:#fff; padding: 8px; border-radius: 6px; display:flex; align-items:center; justify-content:center; }
  #chartMsurCont  { grid-column: 2 / 4; grid-row: 16 / 29; background:#fff; padding: 8px; border-radius: 6px; display:flex; align-items:center; justify-content:center; }
  #chartMcola, #chartMsur { width:100%; height:100%; }

  #infoPanel     { grid-column: 2 / 4; grid-row: 14 / 16; background:#fff; border-radius:6px; padding:4px 6px; display:flex; justify-content:space-between; align-items:center; gap:6px; font-size:.85rem }
  #infoPanelMsur { grid-column: 2 / 4; grid-row: 29 / 31; background:#fff; border-radius:6px; padding:4px 6px; display:flex; justify-content:space-between; align-items:center; gap:6px; font-size:.85rem }
  .infoBox { display:flex; align-items:baseline; background:#f9f9f9; border:1px solid #ddd; border-radius:4px; padding:2px 4px; gap:4px; white-space:nowrap; }
  .infoBox .label { font-weight:700; margin-right:2px; }
  .infoBox .value { font-weight:600; }

  #donutCaptCont { grid-column: 4 / 6; grid-row: 1 / 23; background:#fff; padding:8px; border-radius:6px; display:flex; align-items:center; justify-content:center; }
  #donutCapt { width:100%; height:100%; }

  #panelLance { grid-column: 4 / 6; grid-row: 23 / 31; background:#fff; border-radius:6px; padding:8px; display:flex; flex-direction:column; gap:6px; font-size:.85rem }
  .legend { display:flex; justify-content:center; gap:12px; font-weight:600 }
  .legend .sq{ width:10px; height:10px; display:inline-block; margin-right:4px }
  .sq.mcola{ background:#f28e2b } .sq.msur{ background:#4e79a7 } .sq.otros{ background:#76b7b2 }
  .kgs{ display:flex; justify-content:center; gap:24px } .kgBox{ border:1px solid #000; padding:6px 16px; font-weight:700 }
  .meta{ border-collapse:collapse; width:100%; margin-top:6px } .meta th, .meta td{ border:1px solid #000; padding:4px; text-align:center } .meta th{ background:#f0f0f0 }

  /* Map */
  #mapLance{ grid-column: 6 / 8; grid-row: 1 / 31; width:100%; height:100%; border:1px solid #ddd; border-radius:6px }
  .lance-icon div{ width:14px; height:14px; border-radius:50%; border:2px solid #fff; box-shadow:0 0 2px #0003 }
  .leaflet-tooltip.lance-label{ background:#fff; border:1px solid #999; border-radius:3px; padding:2px 4px; font-size:11px; font-weight:bold; color:#333 }
</style>

<link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"/>
<script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>

.transect-label {
  background: transparent;
  padding: 0;
  border: none;
  font: 14px/1.2 Arial, sans-serif;
  font-weight: bold;
  color: #222;
  text-shadow:
    -1px -1px 0 #fff,

     0px  0px 2px #fff;
  pointer-events: none;
  white-space: nowrap;
}
</style>

<style id="selectorFix">
#selector{overflow:visible!important;max-height:none!important;display:grid!important;grid-template-columns:repeat(auto-fit,minmax(88px,1fr))!important;gap:6px!important;}
#selector button{width:100%!important;padding:8px 6px!important;border:1px solid #e3e7ef!important;background:#fff!important;color:#111!important;border-radius:8px!important;font-weight:700!important;font-size:.85rem!important;line-height:1.05!important;}
@media (max-width:1200px){#selector{grid-template-columns:repeat(auto-fit,minmax(76px,1fr))!important;}#selector button{font-size:.8rem!important;padding:7px 5px!important;}}
</style>

/* === State === */
const state = { multi:false, selected:new Set() };

/* === Build selector buttons === */
const selector = document.getElementById('selector');
// Botón TOTAL (acumulado)
const btnTotal = document.createElement('button');
btnTotal.textContent = 'Total';
btnTotal.dataset.lance = 'TOTAL';
selector.appendChild(btnTotal);
// Botones de lances individuales
lances.forEach(num => {
  const btn = document.createElement('button');
  btn.textContent = `Lance ${num}`;
  btn.dataset.lance = num;
  selector.appendChild(btn);
});
selector.addEventListener('click', (e)=>{
  const btn = e.target.closest('button'); if(!btn) return;
  updateAll(btn.dataset.lance);
});

/* === Toggle bar handlers === */
const btnMulti = document.getElementById('toggleMulti');
const btnAll   = document.getElementById('selAll');
const btnNone  = document.getElementById('selNone');
const selCount = document.getElementById('selCount');
function syncControls(){
  btnMulti.classList.toggle('is-on', state.multi);
  btnMulti.textContent = state.multi ? 'Multi ON' : 'Multi OFF';
  btnMulti.setAttribute('aria-pressed', String(state.multi));
  btnAll.disabled  = !state.multi;
  btnNone.disabled = !state.multi;
  selCount.textContent = `${state.selected.size} seleccionado${state.selected.size===1?'':'s'}`;
}
btnMulti.addEventListener('click', ()=>{
  state.multi = !state.multi;
  if(!state.multi && state.selected.size>1){
    const first = Array.from(state.selected)[0];
    state.selected.clear(); state.selected.add(first);
  }
  updateButtons(); redrawAll();
});
btnAll.addEventListener('click', ()=>{
  if(!state.multi) return;
  state.selected.clear(); lances.forEach(n=>state.selected.add(n));
  updateButtons(); redrawAll();
});
btnNone.addEventListener('click', ()=>{
  if(!state.multi) return;
  state.selected.clear(); state.selected.add(lances[0]);
  updateButtons(); redrawAll();
});

function updateAll(lanceClicked){
  const isTotal = (lanceClicked === 'TOTAL');
  if (isTotal){
    // Forzamos modo simple en "Total"
    state.multi = false;
    state.selected.clear(); state.selected.add('TOTAL');
  } else {
    const n = Number(lanceClicked);
    if (state.multi){
      if (state.selected.has(n)) state.selected.delete(n); else state.selected.add(n);
      if (state.selected.size === 0) state.selected.add(n);
    } else {
      state.selected.clear(); state.selected.add(n);
    }
  }
  updateButtons(); redrawAll();
}
function updateButtons(){
  document.querySelectorAll('#selector button').forEach(btn=>{
    const id = btn.dataset.lance;
    const key = (id === 'TOTAL') ? 'TOTAL' : Number(id);
    const active = state.selected.has(key);
    btn.classList.toggle('active', active);
    btn.setAttribute('aria-pressed', active);
  });
  syncControls();
}


/* === Helpers de TOTAL === */
function sumArrays(arrs){
  if(!arrs || !arrs.length) return [];
  const out = new Array(arrs[0].length).fill(0);
  for(const a of arrs){
    if(!a) continue;
    for(let i=0;i<out.length;i++) out[i] += (a[i]||0);
  }
  return out;
}

function drawChartCola(){
  const ctx = document.getElementById('chartMcola').getContext('2d');
  let datasets;
  const isTotal = state.selected.has('TOTAL');

    const arrs = lances.map(l=> dataByLance[String(l)]);
    const totalArr = sumArrays(arrs);
    datasets = [{

      fill:false, tension:0.3, borderWidth:3, pointRadius:3,
      borderColor: '#111', pointBackgroundColor: '#111'
    }];
  } else {
    datasets = Array.from(state.selected).map(l=>({
      label:'Lance '+l, data: (Array.isArray(dataByLance[String(l)]) ? dataByLance[String(l)] : new Array(classes.length).fill(0)), fill:false, tension:0.3, borderWidth:2, pointRadius:3,
      borderColor: colorFor(l), pointBackgroundColor: colorFor(l)
    }));

    chartC = new Chart(ctx,{ type:'line', data:{labels:classes,datasets},

function aggregateCapturas(){ const sum=[0,0,0]; state.selected.forEach(l=>{ const v=dataCapt[String(l)]; if(v){ for(let i=0;i<3;i++) sum[i]+=v[i]; } }); return sum; }
function drawDonut(){

/* === Detail panels (single-lance) === */


function updateInfoCola(l){
  const freqsRaw = dataByLance[String(l)];
  updateInfoColaFromArray(Array.isArray(freqsRaw) ? freqsRaw : new Array(classes.length).fill(0));
}

function updateInfoColaFromArray(freqs){
  const arr = Array.isArray(freqs) ? freqs : new Array(classes.length).fill(0);
  const total = arr.reduce((a,b)=>a+(b||0),0);
  if (total <= 0){
    document.getElementById('valModa').textContent = '–';
    document.getElementById('valFrec').textContent = 0;
    document.getElementById('valRango').textContent = '–';
    document.getElementById('valTotal').textContent = 0;
    return;
  }
  const maxFreq = Math.max(...arr);
  const modeIndex = arr.findIndex(v => v === maxFreq);
  const firstIdx = arr.findIndex(v => (v||0) > 0);
  const lastIdx = arr.length - 1 - [...arr].reverse().findIndex(v => (v||0) > 0);
  const rango = classes[firstIdx] + ' / ' + classes[lastIdx];
  document.getElementById('valModa').textContent = classes[modeIndex];
  document.getElementById('valFrec').textContent = maxFreq;
  document.getElementById('valRango').textContent = rango;
  document.getElementById('valTotal').textContent = total;
}


function updateInfoSur(l){
  const arrRaw = dataMsur[String(l)];
  updateInfoSurFromArray(Array.isArray(arrRaw) ? arrRaw : new Array(classes.length).fill(0));
}


function updateInfoSurFromArray(arrIn){
  const arr = Array.isArray(arrIn) ? arrIn : new Array(classes.length).fill(0);
  const total = arr.reduce((a,b)=>a+(b||0),0);
  if (total <= 0){
    document.getElementById('valModaS').textContent = '–';
    document.getElementById('valFrecS').textContent = 0;
    document.getElementById('valRangoS').textContent = '–';
    document.getElementById('valTotalS').textContent = 0;
    return;
  }
  const max = Math.max(...arr);
  const modeIdx = arr.findIndex(v => v === max);
  const firstIdx = arr.findIndex(v => (v||0) > 0);
  const lastIdx = arr.length - 1 - [...arr].reverse().findIndex(v => (v||0) > 0);
  const rango = `${classes[firstIdx]} / ${classes[lastIdx]}`;
  document.getElementById('valModaS').textContent  = classes[modeIdx];
  document.getElementById('valFrecS').textContent  = max;
  document.getElementById('valRangoS').textContent = rango;
  document.getElementById('valTotalS').textContent = total;
}
function updateLancePanel(l){
  const d = lanceInfo[String(l)]; if(!d) return;
  document.getElementById('kgMsur').textContent  = d.Msur.toFixed(1);
  document.getElementById('kgMcola').textContent = d.Mcola.toFixed(1);
  document.getElementById('kgOtros').textContent = d.Otros.toFixed(1);
  document.getElementById('metaFecha').textContent = d.Fecha;
  const c = coordsLance[String(l)];

  document.getElementById('metaLon').textContent = c ? formatDegMin(c[1], false) : '–';

/* === Map === */
let mapL, markers=[];
function initMap(){
  mapL = L.map('mapLance').setView([-43,-75], 9);
  L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png',{maxZoom:18,attribution:'© OpenStreetMap contributors'}).addTo(mapL);
  L.control.scale({imperial:false}).addTo(mapL);
  const resetBtn = L.control({position:'topleft'});
  resetBtn.onAdd = function(){
    const btn = L.DomUtil.create('button','leaflet-bar'); btn.style.cssText='width:30px;height:30px;cursor:pointer;background:#fff;'; btn.textContent='⟳';
    btn.title='Reset vista'; btn.onclick=(e)=>{ e.preventDefault(); showMap(); };
    return btn;
  };
  resetBtn.addTo(mapL);
}
function formatDegMin(dec, isLat){ if(dec==null||isNaN(dec)) return '–'; const hemi=isLat?(dec<0?'S':'N'):(dec<0?'W':'E'); const a=Math.abs(dec); const deg=Math.floor(a); const mtr=Math.trunc(((a-deg)*60)*10)/10; const ms=mtr.toFixed(1).replace('.',','); return `${deg}° ${ms}′ ${hemi}`; }
function makeLanceIcon(l){ return L.divIcon({ className:'lance-icon', html:`<div style="background:${['#1f77b4','#ff7f0e','#2ca02c','#d62728','#9467bd','#8c564b','#e377c2','#7f7f7f','#bcbd22','#17becf'][(Number(l)-1)%10]}"></div>`, iconSize:[18,18], iconAnchor:[9,9], popupAnchor:[0,-9] }); }
function showMap(){
  if(!mapL) initMap();
  markers.forEach(m=> mapL.removeLayer(m)); markers=[];
  const isTotal = state.selected.has('TOTAL');
  const sel = isTotal ? lances : Array.from(state.selected);
  sel.forEach(l=>{
    const p = coordsLance[String(l)]; if(!p) return;
    const m = L.marker(p,{icon:makeLanceIcon(l)}).addTo(mapL).bindTooltip('Lance '+l,{permanent:true,direction:'top',offset:[0,-10],className:'lance-label'});
    m.on('click',()=> updateAll(String(l))); markers.push(m);
  });
  if(markers.length){
    if(sel.length===1){ mapL.setView(markers[0].getLatLng(),9); }
    else { const g = new L.featureGroup(markers); mapL.fitBounds(g.getBounds().pad(0.3), {maxZoom:9}); }
  }
}

/* === Panels + expansion === */
function updatePanels(){
  const isTotal = state.selected.has('TOTAL');
  const single  = (state.selected.size===1) && !isTotal;

  // Mostrar/ocultar paneles informativos según modo
  const infoCola = document.getElementById('infoPanel');
  const infoSur  = document.getElementById('infoPanelMsur');
  if (infoCola) infoCola.style.display = single ? '' : 'none';
  if (infoSur)  infoSur.style.display  = single ? '' : 'none';

  // Panel de lance + donut solo en single
  [document.getElementById('panelLance'),
   document.getElementById('donutCaptCont')].forEach(el=>{ if(el) el.style.display = single ? '' : 'none'; });

  // Ajustar tamaño de contenedores de frecuencia (agrandar en MULTI/TOTAL)
  const c1 = document.getElementById('chartMcolaCont');
  const c2 = document.getElementById('chartMsurCont');
  if (c1 && c2){
    if (single){
      c1.style.gridColumn = '2 / 4'; c1.style.gridRow = '1 / 14';
      c2.style.gridColumn = '2 / 4'; c2.style.gridRow = '16 / 29';
    } else {
      c1.style.gridColumn = '2 / 6'; c1.style.gridRow = '1 / 16';
      c2.style.gridColumn = '2 / 6'; c2.style.gridRow = '16 / 31';
    }
  }

  // Derivar arrays visibles desde los charts (robusto)
  function currentFromChart(chart){
    try{
      if(!chart || !chart.data || !Array.isArray(chart.data.datasets)) return null;
      const arrs = chart.data.datasets.map(ds => Array.isArray(ds.data) ? ds.data : []);
      if(arrs.length===0) return null;
      const len = classes.length, out = new Array(len).fill(0);
      arrs.forEach(a => { for(let i=0;i<len;i++) out[i] += (a[i]||0); });
      return out;
    }catch(e){ return null; }
  }

  const colaVis = currentFromChart(window.chartC);
  const surVis  = currentFromChart(window.chartS);

  if (single){
    const l = Array.from(state.selected)[0];
    if (typeof updateLancePanel==='function') updateLancePanel(l);
  }

  if (typeof updateInfoColaFromArray==='function')
    updateInfoColaFromArray( colaVis || (single ? (Array.isArray(dataByLance[String(Array.from(state.selected)[0])]) ? dataByLance[String(Array.from(state.selected)[0])] : new Array(classes.length).fill(0)) : new Array(classes.length).fill(0)) );
  if (typeof updateInfoSurFromArray==='function')
    updateInfoSurFromArray( surVis  || (single ? (Array.isArray(dataMsur[String(Array.from(state.selected)[0])]) ? dataMsur[String(Array.from(state.selected)[0])] : new Array(classes.length).fill(0)) : new Array(classes.length).fill(0)) );
}

/* === Redraw orchestration === */
function redrawAll(){ drawChartCola(); drawChartSur(); drawDonut(); showMap(); updatePanels(); }

/* === Init === */
document.addEventListener('DOMContentLoaded', ()=>{
  state.selected.add(lances[0]);
  updateButtons(); redrawAll();
});
</script>

<script>
// === Sabana overlay (usa solo columnas Z (sA_Merluza Austral) y AA (sA_Merluza Cola)) ===
let sabanaData = null;
let sabanaLayer = null;
let sabanaLabelsLayer = null;
let sabanaControl = null;
let sabanaVisible = true;
// Solo estas dos claves
const sabanaKeysWanted = ['sA_Merluza Austral','sA_Merluza Cola','NASC_mezcla_MS.MC'];
let sabanaSelectedKey = 'sA_Merluza Austral'; // por defecto
const sabanaLabels = {
  'sA_Merluza Austral': 'sA Merluza austral',
  'sA_Merluza Cola': 'sA Merluza de cola',
  'NASC_mezcla_MS.MC': 'sA Total'
};

function niceLabelFromKey(k){ return k.replace(/^sA_/,'').replace(/_/g,' '); }

function prettyTransectName(name){
  const s = String(name ?? '').trim();
  // ACUST with leading zeros, optional letter, e.g., ACUST0009A
  const m = s.match(/^ACUST0*(\d+)([A-Za-z]?)$/i);
  if(m){
    const num = String(parseInt(m[1], 10));
    const suf = (m[2] || '').toUpperCase();
    return 'Tr. ' + num + suf;
  }
  // numeric-like with trailing .0
  const m2 = s.match(/^(\d+)(?:\.0+)?([A-Za-z]?)$/);
  if(m2){
    const num = String(parseInt(m2[1], 10));
    const suf = (m2[2] || '').toUpperCase();
    return 'Tr. ' + num + suf;
  }
  // default: just prefix with Tr.
  return 'Tr. ' + s;
}
function parseSabanaCSV(){ 
  try{
    const raw = document.getElementById('sabanaCSV').textContent.trim();
    const parsed = Papa.parse(raw, { header:true, dynamicTyping:true });
    sabanaData = parsed.data.filter(r => {
      const lat1 = Number(r.Lat_S), lon1 = Number(r.Lon_S);
      const lat2 = Number(r.Lat_E), lon2 = Number(r.Lon_E);
      // rango válido y descarta sentinelas 999
      const ok =
        Number.isFinite(lat1) && Number.isFinite(lon1) &&
        Number.isFinite(lat2) && Number.isFinite(lon2) &&
        Math.abs(lat1) <= 90 && Math.abs(lat2) <= 90 &&
        Math.abs(lon1) <= 180 && Math.abs(lon2) <= 180 &&
        lat1 !== 999 && lat2 !== 999 && lon1 !== 999 && lon2 !== 999;
      if(!ok) return false;
      // descarta segmentos sospechosos demasiado largos (>0.5° aprox 55 km)
      const d = Math.hypot(lat2 - lat1, lon2 - lon1);
      return d <= 0.5;
    });
  }catch(e){ console.error('Error parseando Sabana:', e); }
}

function getColor(v){
  // Arreglo: valores < 1 se consideran 0 (gris)
  if(v==null || !isFinite(v) || v < 1) return '#bdbdbd'; // NA/0 gris
  if(v <= 640) return 'yellow';
  if(v <= 1280) return 'green';
  if(v <= 2560) return 'blue';
  return 'red';
}

function buildSabanaLayer(){
  if(!mapL || !sabanaData) return;
  if(sabanaLayer){ try{ mapL.removeLayer(sabanaLayer); }catch(_){} }
  sabanaLayer = L.layerGroup();
  // preparar capa de etiquetas
  if(sabanaLabelsLayer){ try{ mapL.removeLayer(sabanaLabelsLayer); }catch(_){} }
  sabanaLabelsLayer = L.layerGroup();

  // Recolectar un punto por cada nombre de transecta
  const labelPoints = new Map();

  // Garantiza que la key exista en el dataset
  const keysExistentes = sabanaKeysWanted.filter(k => k in (sabanaData[0]||{}));
  if(keysExistentes.length === 0) return;
  if(!keysExistentes.includes(sabanaSelectedKey)) sabanaSelectedKey = keysExistentes[0];

 for (const r of sabanaData) {
  const lat1 = Number(r.Lat_S), lon1 = Number(r.Lon_S);
  const lat2 = Number(r.Lat_E), lon2 = Number(r.Lon_E);

  if (Number.isFinite(lat1) && Number.isFinite(lon1) &&
      Number.isFinite(lat2) && Number.isFinite(lon2)) {

    const val = Number(r[sabanaSelectedKey]);
    const valStr = (val != null && Number.isFinite(val))
      ? (val >= 1 ? val.toFixed(1) : '0')
      : 'NA';

    // --- Punto medio con columnas Lat_M / Lon_M (fallback al promedio de extremos)
    const latM = Number(r.Lat_M);
    const lonM = Number(r.Lon_M);
    const useLat = Number.isFinite(latM) ? latM : (lat1 + lat2) / 2;
    const useLon = Number.isFinite(lonM) ? lonM : (lon1 + lon2) / 2;

    // --- Marker circular coloreado por el valor sA seleccionado
    const seg = L.circleMarker([useLat, useLon], {
      radius: 5,
      color: getColor(val),
      fillColor: getColor(val),
      fillOpacity: 0.9,
      weight: 1,
      opacity: 0.9
    });

    // --- Tooltip: UBM en lugar de Fecha/Hora
    const ubm = Number(r.UBM);
    const ubmStr = Number.isFinite(ubm) ? ubm.toFixed(1) : 'NA';
    seg.bindTooltip(
      `${sabanaLabels[sabanaSelectedKey] || niceLabelFromKey(sabanaSelectedKey)}: ${valStr}\nUBM: ${ubmStr}`,
      { direction: 'top' }
    );

    sabanaLayer.addLayer(seg);

    // --- Registrar punto para etiqueta (se mantiene en INICIO)
    const tname = (r.Transecta != null && String(r.Transecta).trim() !== '')
      ? String(r.Transecta).trim()
      : null;

    if (tname && !labelPoints.has(tname)) {
      const useLatLabel = Number(r.Lat_S);
      const useLonLabel = Number(r.Lon_S);
      if (Number.isFinite(useLatLabel) && Number.isFinite(useLonLabel)) {
        labelPoints.set(tname, [useLatLabel, useLonLabel]);
      }
    }
  }
}

  if(sabanaVisible) sabanaLayer.addTo(mapL);
  // pintar etiquetas
  try{
    for(const [name, vals] of labelPoints.entries()){
      const [lt, ln] = vals;
      let idx = null;
      let s = String(name).trim();
      let m = s.match(/^\s*ACUST0*(\d+)/i) || s.match(/^(\d+)/);
      if(m){ idx = parseInt(m[1], 10); }
      const isTr1 = (idx === 1);

      const base = L.latLng(lt, ln);
      const p = mapL.latLngToLayerPoint(base);
      const p2 = L.point(p.x + (isTr1 ? 3 : -6), p.y);
      const loc = mapL.layerPointToLatLng(p2);

      const icon = L.divIcon({ className: 'transect-label', html: prettyTransectName(name), iconAnchor: [0, 8] });
      const mkr = L.marker(loc, { icon, interactive: false, keyboard: false });
      sabanaLabelsLayer.addLayer(mkr);
    }
    if(sabanaVisible) sabanaLabelsLayer.addTo(mapL);
  }catch(e){ console.warn('No se pudieron generar etiquetas:', e); }
}

function ensureSabanaControl(){
  if(!mapL || sabanaControl) return;
  sabanaControl = L.control({position:'topright'});
  sabanaControl.onAdd = function(){
    const wrap = L.DomUtil.create('div','leaflet-bar sabana-ctl');
    wrap.style.background = '#fff';
    wrap.style.padding = '6px';
    wrap.style.minWidth = '180px';
    wrap.style.font = '12px/1.2 Arial, sans-serif';
    wrap.style.boxShadow = '0 1px 3px rgba(0,0,0,.25)';
    wrap.innerHTML = `
      <label style="display:block;margin:2px 0 4px;font-weight:bold">Valor sA</label>
      <select id="saSelect" style="width:100%;margin-bottom:6px">
        <option value="sA_Merluza Austral">Merluza austral</option>
        <option value="sA_Merluza Cola" selected>Merluza de cola</option>
        <option value="NASC_mezcla_MS.MC">sA Total</option>
      </select>
      <label style="display:flex;align-items:center;gap:6px;margin-bottom:6px">
        <input type="checkbox" id="saToggle" checked />
        <span>Mostrar transecta</span>
      </label>
      <div style="display:grid;grid-template-columns:16px 1fr;gap:4px;align-items:center">
        <div style="width:12px;height:12px;background:#bdbdbd;border:1px solid #999"></div><span>NA / 0</span>
        <div style="width:12px;height:12px;background:yellow;border:1px solid #999"></div><span>1 – 640</span>
        <div style="width:12px;height:12px;background:green;border:1px solid #999"></div><span>641 – 1280</span>
        <div style="width:12px;height:12px;background:blue;border:1px solid #999"></div><span>1281 – 2560</span>
        <div style="width:12px;height:12px;background:red;border:1px solid #999"></div><span>&gt; 2560</span>
      </div>
    `;
    const stop = (e)=>{ e.stopPropagation(); };
    wrap.addEventListener('mousedown', stop);
    wrap.addEventListener('dblclick', stop);
    wrap.addEventListener('pointerdown', stop);
    setTimeout(()=>{
      const sel = document.getElementById('saSelect');
      if(sel){ sel.value = sabanaSelectedKey; sel.addEventListener('change', (e)=>{ sabanaSelectedKey = e.target.value; buildSabanaLayer(); }); }
      const tog = document.getElementById('saToggle');
      if(tog){ tog.addEventListener('change', (e)=>{ 
        sabanaVisible = !!e.target.checked; 
        if(!mapL||!sabanaLayer) return; 
        if(sabanaVisible){ sabanaLayer.addTo(mapL); if(sabanaLabelsLayer) sabanaLabelsLayer.addTo(mapL);} else { mapL.removeLayer(sabanaLayer); if(sabanaLabelsLayer) mapL.removeLayer(sabanaLabelsLayer);}
      });}
    }, 0);
    return wrap;
  };
  sabanaControl.addTo(mapL);
}

// Envolvemos showMap para montar la capa
const __origShowMap = (typeof showMap==='function') ? showMap : function(){};
showMap = function(){
  __origShowMap();
  if(!sabanaData) parseSabanaCSV();
  ensureSabanaControl();
  buildSabanaLayer();
};
</script>


<!-- Patch: robust panels + donut reset for Lance 1 / empty arrays -->
<script>
(function(){
  // Helpers
  const classes = window.classes || [];
  const zero = ()=> new Array(classes.length).fill(0);

  // Override: Cola panel (safe defaults when data is missing)
  const _oldUpdateInfoCola = window.updateInfoCola;
  window.updateInfoCola = function(l){
    try{
      const freqs = (window.dataByLance && window.dataByLance[String(l)]) || zero();
      const total = freqs.reduce((a,b)=>a+b,0);
      const max = Math.max(...freqs);
      const modeIdx = freqs.indexOf(max);
      const firstIdx = freqs.findIndex(f=>f>0);
      const lastIdx  = freqs.length - 1 - [...freqs].reverse().findIndex(f=>f>0);

      const el = (id)=>document.getElementById(id);
      if(el('valModa'))   el('valModa').textContent   = modeIdx>=0 ? classes[modeIdx] : '–';
      if(el('valFrec'))   el('valFrec').textContent   = Number.isFinite(max) ? max : 0;
      if(el('valRango'))  el('valRango').textContent  = (firstIdx===-1 || lastIdx===-1) ? '–' : `${classes[firstIdx]} / ${classes[lastIdx]}`;
      if(el('valTotal'))  el('valTotal').textContent  = total || 0;
    }catch(e){
      console.error('updateInfoCola (patched) error', e);
      if(typeof _oldUpdateInfoCola==='function') _oldUpdateInfoCola(l);
    }
  };

  // Override: Sur panel (safe defaults when data is missing)
  const _oldUpdateInfoSur = window.updateInfoSur;
  window.updateInfoSur = function(l){
    try{
      const arr = (window.dataMsur && window.dataMsur[String(l)]) || zero();
      const total = arr.reduce((a,b)=>a+b,0);
      const max = Math.max(...arr);
      const modeIdx = arr.indexOf(max);
      const firstIdx = arr.findIndex(v=>v>0);
      const lastIdx  = arr.length - 1 - [...arr].reverse().findIndex(v=>v>0);

      const el = (id)=>document.getElementById(id);
      if(el('valModaS'))  el('valModaS').textContent  = modeIdx>=0 ? classes[modeIdx] : '–';
      if(el('valFrecS'))  el('valFrecS').textContent  = Number.isFinite(max) ? max : 0;
      if(el('valRangoS')) el('valRangoS').textContent = (firstIdx===-1 || lastIdx===-1) ? '–' : `${classes[firstIdx]} / ${classes[lastIdx]}`;
      if(el('valTotalS')) el('valTotalS').textContent = total || 0;
    }catch(e){
      console.error('updateInfoSur (patched) error', e);
      if(typeof _oldUpdateInfoSur==='function') _oldUpdateInfoSur(l);
    }
  };

  // Override: donut — clear dataset before redibujar para evitar estado pegado
  const _oldDrawDonut = window.drawDonut;
  window.drawDonut = function(){
    try{
      if(window.chartD && chartD.data){
        chartD.data.datasets = [{ data: [0,0,0] }];
      }
    }catch(e){ console.warn('drawDonut reset warn', e); }
    if(typeof _oldDrawDonut==='function') return _oldDrawDonut();
  };
})();
</script>

<script>
// Safe fallbacks (properly scoped)
if (typeof window.sumArrays !== 'function') {
  window.sumArrays = function(arrs){
    const len = (typeof classes!=='undefined' && Array.isArray(classes)) ? classes.length : 0;
    const out = new Array(len).fill(0);
    (arrs||[]).forEach(a => { if(Array.isArray(a)) for(let i=0;i<len;i++) out[i] += (a[i]||0); });
    return out;
  };
}
// Guard showMap if not defined yet
if (typeof window.showMap !== 'function') {
  window.showMap = function(){ /* no-op */ };
}
</script>

<script>
(function(){
  const oldSum = window.sumArrays;
  window.sumArrays = function(arrs){
    try{
      if(!arrs || !arrs.length) return [];
      const base = arrs.find(a=>Array.isArray(a)&&a.length);
      if(!base) return [];
      const out = new Array(base.length).fill(0);
      for(const a of arrs){ if(!Array.isArray(a)) continue; for(let i=0;i<out.length;i++) out[i] += (a[i]||0); }
      return out;
    }catch(e){ console.error('sumArrays override error', e); return oldSum?oldSum(arrs):[]; }
  };
})();
(function(){
  if(!window.drawDonut) return;
  const oldDraw = window.drawDonut;
  window.drawDonut = function(){
    const cont = document.getElementById('donutCaptCont');
    const isTotal = window.state && state.selected && state.selected.has('TOTAL');
    if(cont) cont.style.display = isTotal ? 'none' : 'flex';
    if(isTotal) return;
    return oldDraw();
  };
})();
</script>
